import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the search input
    await page.waitForSelector('input.search-input');
    await page.click('input.search-input');

    // Type "tutorial" into the search input
    await page.fill('input.search-input', 'tutorial');

    // Click the search button
    await page.waitForSelector('button.search-btn');
    await page.click('button.search-btn');

    // Wait for the results page to load
    await page.waitForLoadState('networkidle');

    // Take a screenshot of the results page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_results_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_results_page.png'));

    // Verify that the results page contains videos
    const videosLoaded = await page.waitForSelector('.video-grid', { timeout: 5000 });
    const videoCount = await page.evaluate(() => document.querySelectorAll('.video-grid .video-item').length);

    return {
      success: true,
      action: "Searched for 'tutorial' and verified that the results page loaded with videos.",
      extractedData: { videoCount },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('input.search-input'); // Selector for search input
    await page.fill('input.search-input', 'tutorial'); // Fill the search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_search_input.png'));

    // Click the search button
    await page.waitForSelector('button.search-btn'); // Selector for search button
    await page.click('button.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_clicked_search_button.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_clicked_search_button.png'));

    // Wait for the results page to load
    await page.waitForSelector('.video-grid'); // Wait for the video grid to ensure results are loaded
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_results_page_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_results_page_loaded.png'));

    // Verify that the video grid is displayed
    const videoGridVisible = await page.isVisible('.video-grid');
    if (!videoGridVisible) {
      throw new Error('Video grid not visible after search');
    }

    // Extracting data to verify task completion
    const videos = await page.$$eval('.video-grid .video-item', items => items.map(item => item.innerText));
    const extractedData = { videos };

    return {
      success: true,
      action: "Successfully searched for 'tutorial' and verified that search results page loaded with videos.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

